0.ds_documentacao:
No ato da matrícula, o candidato selecionado deverá apresentar e entregar a seguinte documentação em fotocópia, juntamente com o documento original para autenticação, ou, devidamente autenticada: 
a. certificado de conclusão do ensino médio ou equivalente e histórico escolar; 
b. documento de identidade (documento oficial com foto); 
c. título de eleitor (para maiores de 18 anos); 
d. documento de quitação com o Serviço Militar (para homens maiores de 18 anos); 
e. cadastro de Pessoa Física - CPF; 
f. 01 (uma) foto 3x4 colorida e recente; 
g. comprovante original de endereço completo com CEP e atualizado (últimos três meses).

